import React from "react";
import { useNavigate } from "react-router-dom";

import { useAuth } from "../../Contexter/AuthContext";

function userNameHolder(event){
	console.log(event.target.value);
}

export function Login() {
	const { isUserLoggedIn, setIsUserLoggedIn } = useAuth();
	const navigate = useNavigate();
	return (
		<>
			<h1> Chhabhi laaya kya? </h1>
			<input type="text" name="username" placeholder="please enter your user name" onChange={userNameHolder}/>
			<button	
                onClick={() => 
                    {setIsUserLoggedIn((isUserLoggedIn) => !isUserLoggedIn);isUserLoggedIn || navigate("/")}}
            >
				{isUserLoggedIn ? "I am logged In" : "I am logged out"}
			</button>
		</>
	);
}
